import React from 'react'
import "../Header/header.css"
import { Link } from 'react-router-dom'

const header = () => {
    const navlinks = [
        {
            links: "Login",
            path: "/login",
        },
        {
            links: "Sign Up",
            path: "/signup",
        },
    ]
    return (
        <div>
            <div className='container-fluid'>
                <nav className="navbar-expand-lg bg-body-tertiary">

                    <a className="navbar-brand" href="#">BenchmarkYou</a>
<div className='nav-it'></div>
                    <div className="nav-items">
                    {navlinks.map((item) => (
                        <Link

                           
                            aria-current="page"
                            to={item.path}
                            className={item.path === '/login' ? 'log-dif' : ''}

                        >
                            {item.links}
                        </Link>
                    ))}
                     </div>
                </nav>
                
            </div>
        </div>
    )
}

export default header
